s.aN(0,"Mouse Movement",new A.aBG(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/input/mouse_movement_example.dart","    In this example we show how you can use `MouseMovementDetector`.\n\n\n    Move around the mouse on the canvas and the white square will follow it and\n    turn into blue if it reaches the mouse, or the edge of the canvas.\n  ")
s.aN(0,"Mouse Cursor",new A.aBH(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/input/mouse_cursor_example.dart","    Example showcasing the ability to change the game cursor in runtime\n    hover the little square to see the cursor changing\n  ")
s.aN(0,"Scroll",new A.aBI(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/input/scroll_example.dart","    In this example we show how to use the `ScrollDetector`.\n\n\n    Scroll within the canvas (both horizontally and vertically) and the white\n    square will move around.\n  ")
s.aN(0,"Multitap",new A.aBJ(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/input/multitap_example.dart","    In this example we showcase the multi touch capabilities\n    Touch multiple places on the screen and you will see multiple squares drawn,\n    one under each finger.\n  ")
