s.aN(0,"Overlapping Tappables",new A.aBL(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/input/overlapping_tappables_example.dart","    In this example we show how you can stop event propagation to the components\n    by returning `false` in the overridden event handler method. In this case we\n    use `onTapUp`, `onTapDown` and `onTapCancel` from the `Tappable mixin.\n  ")
s.aN(0,"Gesture Hitboxes",new A.aBB(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/simple_shapes_example.dart","    Tap to create a PositionComponent with a randomly shaped hitbox.\n    You can then hover over to shapes to see that they receive the hover events\n    only when the cursor is within the shape. If you tap/click within the shape\n    it is removed.\n  ")
